import React, { useState, useEffect, useRef } from "react";


const Aanbodlist = () => {
  const [openDropdown, setOpenDropdown] = useState(null);
  const dropdownRef = useRef(null);

  // Close dropdown on outside click
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
        setOpenDropdown(null);
      }
    };
    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);

  const toggleDropdown = (key) => {
    setOpenDropdown(openDropdown === key ? null : key);
  };

  return (
    <main>
      {/* Filter Section */}
      <section className="aanbod-filter-sec aanbod-list-filter">
        <div className="aanbod-filter-bg-mark">
          <img src="assets/aanbod-filter-bg-mark.svg" alt="" className="w-100" />
        </div>
        <div className="container">
          <div className="aanbod-filter-wrap" ref={dropdownRef}>
            <div className="hidden-filter">
              <div className="filter-main">
                <div className="row">
                  <div className="col-xl-9">
                    <div className="filter-left-area">
                      <div className="filter-left-heading">
                        <h3>Filter op:</h3>
                      </div>
                      <div className="row align-items-center">
                        {/* Merk Filter */}
                        <div className="col-lg-3 col-6 aanbod-filter merk-filter">
                          <div className="each-filter dropdown" data-val="Merk">
                            <div
                              className={`select-style ${openDropdown === "merk" ? "active" : ""}`}
                              onClick={() => toggleDropdown("merk")}
                            >
                              <span>Merk</span>
                              <i className="arrow"></i>
                            </div>
                            {openDropdown === "merk" && (
                              <div className="filter-content dropdown-menu show">
                                <label>
                                  <input type="checkbox" value="Alfa Romeo" /> Alfa Romeo{" "}
                                  <span className="count">3</span>
                                </label>
                                <label>
                                  <input type="checkbox" value="Audi" /> Audi{" "}
                                  <span className="count">1</span>
                                </label>
                                <label>
                                  <input type="checkbox" value="BMW" /> BMW{" "}
                                  <span className="count">1</span>
                                </label>
                                <label>
                                  <input type="checkbox" value="Citroën" /> Citroën{" "}
                                  <span className="count">2</span>
                                </label>
                                <label>
                                  <input type="checkbox" value="Fiat" /> Fiat{" "}
                                  <span className="count">1</span>
                                </label>
                                <label>
                                  <input type="checkbox" value="Jaguar" /> Jaguar{" "}
                                  <span className="count">1</span>
                                </label>
                              </div>
                            )}
                          </div>
                        </div>

                        {/* Model Filter */}
                        <div className="col-lg-3 col-6 aanbod-filter">
                          <div className="each-filter dropdown">
                            <div
                              className={`select-style ${openDropdown === "model" ? "active" : ""}`}
                              onClick={() => toggleDropdown("model")}
                            >
                              <span>Model</span>
                              <i className="arrow"></i>
                            </div>
                            {openDropdown === "model" && (
                              <div className="filter-content dropdown-menu show">
                                <label>
                                  <input type="checkbox" /> Giulia
                                </label>
                                <label>
                                  <input type="checkbox" /> Stelvio
                                </label>
                                <label>
                                  <input type="checkbox" /> Tonale
                                </label>
                              </div>
                            )}
                          </div>
                        </div>

                        {/* Brandstof Filter */}
                        <div className="col-lg-3 col-6 aanbod-filter">
                          <div className="each-filter dropdown">
                            <div
                              className={`select-style ${openDropdown === "brandstof" ? "active" : ""}`}
                              onClick={() => toggleDropdown("brandstof")}
                            >
                              <span>Brandstof</span>
                              <i className="arrow"></i>
                            </div>
                            {openDropdown === "brandstof" && (
                              <div className="filter-content dropdown-menu show">
                                <label>
                                  <input type="checkbox" /> Benzine{" "}
                                  <span className="count">47</span>
                                </label>
                                <label>
                                  <input type="checkbox" /> Hybride{" "}
                                  <span className="count">16</span>
                                </label>
                                <label>
                                  <input type="checkbox" /> Diesel{" "}
                                  <span className="count">6</span>
                                </label>
                              </div>
                            )}
                          </div>
                        </div>

                        {/* Transmissie Filter */}
                        <div className="col-lg-3 col-6 aanbod-filter">
                          <div className="each-filter dropdown">
                            <div
                              className={`select-style ${openDropdown === "transmissie" ? "active" : ""}`}
                              onClick={() => toggleDropdown("transmissie")}
                            >
                              <span>Transmissie</span>
                              <i className="arrow"></i>
                            </div>
                            {openDropdown === "transmissie" && (
                              <div className="filter-content dropdown-menu show">
                                <label>
                                  <input type="checkbox" /> Automaat{" "}
                                  <span className="count">34</span>
                                </label>
                                <label>
                                  <input type="checkbox" /> Handgeschakeld{" "}
                                  <span className="count">35</span>
                                </label>
                              </div>
                            )}
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>

                  {/* Sorteren op */}
                  <div className="col-xl-3">
                    <div className="each-filter dropdown">
                      <div
                        className={`select-style ${openDropdown === "sorteren" ? "active" : ""}`}
                        onClick={() => toggleDropdown("sorteren")}
                      >
                        <span>Sorteren op</span>
                        <i className="arrow"></i>
                      </div>
                      {openDropdown === "sorteren" && (
                        <div className="filter-content dropdown-menu show">
                          <label>
                            <input type="checkbox" /> Nieuw naar oud
                          </label>
                          <label>
                            <input type="checkbox" /> Oud naar nieuw
                          </label>
                        </div>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            </div>

            {/* Reset filters */}
            <div className="filter-reset text-end mt-3">
              <a href="#" className="reset_all_filter">
                Reset filters ✕
              </a>
            </div>
          </div>
        </div>
      </section>
    </main>
  );
};

export default Aanbodlist;
